// src/App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Correct import of Routes and Route
import LoginPage from './pages/LoginPage'; // Add LoginPage import
import OtpPage from './pages/OtpPage'; // Import OTP verification page
import HomePage from './pages/HomePage';
import QuizPage from './pages/QuizPage';
import QuizResultPage from './pages/QuizResultPage';

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Login route */}
        <Route path="/" element={<LoginPage />} /> 

        {/* OTP verification route */}
        <Route path="/verify-otp" element={<OtpPage />} />  {/* Add OTP route */}

        {/* After successful login, user will be redirected to the home page */}
        <Route path="/home" element={<HomePage />} />

        {/* Quiz Page */}
        <Route path="/quiz/:id" element={<QuizPage />} />

        {/* Quiz Result Page */}
        <Route path="/quiz-results/:id" element={<QuizResultPage />} />
      </Routes>
    </Router>
  );
};

export default App;
